const initialState = {
	settings: {
		is_absences_layer: false,
		is_time_layer: false,
	},
	employee_next_id: 1,
	employees: [],
	schedules: [],
	dates: [],
}

const defaultReducer = ( state = initialState, action) => {
	switch( action.type ) {
		default:
			return state;
	}
}

export default defaultReducer;
